// Bootstrap CSS
import "bootstrap/dist/css/bootstrap.min.css";
import "bootstrap/dist/js/bootstrap.min.js";
import Navbar from "./Components/Navbar";
import News from "./Components/News";
import "./App.css";
import {BrowserRouter,
        Switch,
        Route}
        from "react-router-dom"

function App() {
  return (
    <>
    <BrowserRouter>
    <Navbar/>
    {/* <News key="general" category="sports"/> */}
      <Switch>
        <Route path="/"><News key="general" category="general"/></Route>
        <Route path="/business"><News key="business" category="business"/></Route>  
        <Route path="/sports"><News key="sportsl" category="sports"/></Route>
        <Route path="/technology"><News key="technology" category="technology"/></Route>
        <Route path="/science"><News key="science" category="science"/></Route>
        <Route path="/health"><News key="health" category="health"/></Route>
        <Route path="/entertainment"><News key="entertainment" category="entertainment"/></Route>
      </Switch>
    </BrowserRouter>
    </>
  )
}

export default App;
